import {
  Box,
  Button,
  Table,
  TableBody,
  TableCell,
  TableHead,
  TableRow,
} from "@material-ui/core";
import React, { useEffect } from "react";
import { useDispatch, useSelector } from "react-redux";
import { acGetUsersRequest } from "./../../../../Actions";
import OrderItem from "./../../../../Components/MemberShip/Order/OrderItem";

export default function Order() {
  const users = useSelector((state) => state.users);
  const dispatch = useDispatch();

  useEffect(() => {
    dispatch(acGetUsersRequest());
  }, []);

  const handleAccept = (id, uid) => {
    let index = users.findIndex((user) => user.id === id);
    console.log(users[index].myProducts.id);
  };

  return (
    <Box
      className="body-admin m-0 pt-5 px-3 bgr-admin"
      sx={{ minHeight: "100vh" }}
    >
      <Table>
        <TableHead>
          <TableRow>
            <TableCell>ID</TableCell>
            <TableCell>Email</TableCell>
            <TableCell>List Order</TableCell>
            <TableCell colSpan="2">Action</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {users.map((user) => {
            if (user.myProducts) {
              return user.myProducts.map((item, index) => {
                return (
                  <TableRow key={index}>
                    <TableCell>{user.id}</TableCell>
                    <TableCell>{user.email}</TableCell>
                    <TableCell>
                      <OrderItem item={item} color="text-dark" />
                    </TableCell>
                    <TableCell>
                      <Button onClick={() => handleAccept(user.id, item.id)}>
                        Accept
                      </Button>
                    </TableCell>
                    <TableCell>
                      <Button>Cancel</Button>
                    </TableCell>
                  </TableRow>
                );
              });
            }
          })}
        </TableBody>
      </Table>
    </Box>
  );
}
